import axios from 'axios';

const SPREADSHEET_ID = '12PACX-1vTWaVh5yoRpUOKpv78QUeq6tMvBg8Q8n-sEJhQX_XyxKRr5niv1u31Wx2kJuByHYxq1WVKGLTGutTE1'; // Your Google Sheet ID
const API_KEY = process.env.REACT_APP_GOOGLE_API_KEY; // Access the API key from the .env file

const fetchSheetData = async () => {
  const range = 'Sheet1!A2:B'; // Change the range to match your data
  const url = `https://sheets.googleapis.com/v4/spreadsheets/${SPREADSHEET_ID}/values/${range}?key=${API_KEY}`;

  try {
    const response = await axios.get(url);
    return response.data.values; // Returns an array of rows from the sheet
  } catch (error) {
    console.error('Error fetching data:', error);
    return [];
  }
};

export default fetchSheetData;
